import React from 'react';

// Icône Trophy (Événements Sportifs)
export const TrophyIcon = ({ className = "w-12 h-12" }) => (
  <svg className={className} viewBox="0 0 24 24" fill="none" stroke="currentColor">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M9 12l2 2 4-4M7.835 4.697a3.42 3.42 0 001.946-.806 3.42 3.42 0 014.438 0 3.42 3.42 0 001.946.806 3.42 3.42 0 013.138 3.138 3.42 3.42 0 00.806 1.946 3.42 3.42 0 010 4.438 3.42 3.42 0 00-.806 1.946 3.42 3.42 0 01-3.138 3.138 3.42 3.42 0 00-1.946.806 3.42 3.42 0 01-4.438 0 3.42 3.42 0 00-1.946-.806 3.42 3.42 0 01-3.138-3.138 3.42 3.42 0 00-.806-1.946 3.42 3.42 0 010-4.438 3.42 3.42 0 00.806-1.946 3.42 3.42 0 013.138-3.138z" />
  </svg>
);

// Icône Helicopter
export const HelicopterIcon = ({ className = "w-12 h-12" }) => (
  <svg className={className} viewBox="0 0 24 24" fill="currentColor">
    <path d="M21 6h-2V3h-2v3H7V3H5v3H3a1 1 0 000 2h1v2a4 4 0 004 4h1.54l-3.97 5.29a1 1 0 00.08 1.28l2.83 2.83a1 1 0 001.41 0L12 18.59l2.11 2.11a1 1 0 001.41 0l2.83-2.83a1 1 0 00.08-1.28L14.46 11H16a4 4 0 004-4V5h1a1 1 0 000-2zM8 11a2 2 0 01-2-2V7h4v2a2 2 0 01-2 2zm10-2a2 2 0 01-2 2h-2V7h4v2z"/>
  </svg>
);

// Icône Motorcycle/Quad
